func maxSum(nums []int, m int, k int) int64 {
    maxSum := int64(0)
    windowSum := int64(0)
    freq := make(map[int]int)
    distinct := 0

    for i := 0; i < len(nums); i++ {
        // Add the current element to the window
        if freq[nums[i]] == 0 {
            distinct++
        }
        freq[nums[i]]++
        windowSum += int64(nums[i])

        // If the window size exceeds k, slide the window
        if i >= k {
            removed := nums[i-k]
            freq[removed]--
            if freq[removed] == 0 {
                distinct--
            }
            windowSum -= int64(removed)
        }

        // If we have a window of size k, check if it meets the criteria
        if i >= k-1 && distinct >= m {
            maxSum = max(maxSum, windowSum)
        }
    }

    return maxSum
}

func max(a, b int64) int64 {
    if a > b {
        return a
    }
    return b
}
